import React from 'react';
import { withRouter } from "react-router";







const Data =  (props)=>{
   const data = props.data
   
    
    return(
        <>
    
    {data && data.map(data => <h1>{data.name}</h1> ) } 
        </>
    )
}


export default withRouter(Data)



